import React from 'react';
import About from './components/AboutPage.css';

const AboutPage = () => {
  return (
    <div className="about-page">
      <h2>About Wendy's Studio</h2>
      <p>
        Welcome to Wendy's Studio! We are a cozy, modern hair salon dedicated to providing top-notch hair, nail, and hair removal services.
        With a passion for beauty and care, our expert, Wendy, ensures that each client leaves feeling refreshed and confident.
      </p>
      <p>
        At Wendy's Studio, we believe in delivering personalized experiences tailored to each client's unique style and needs. From precise
        haircuts to relaxing nail treatments and efficient waxing services, Wendy is committed to making you look and feel your best.
      </p>
      <p>
        Our salon is your go-to destination for a peaceful, professional beauty experience. Come visit us today, and let Wendy take care of
        all your beauty needs in a cozy, welcoming atmosphere.
      </p>
    </div>
  );
};

export default AboutPage;
